import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Registration.css';
 
function Registration() {
  const [formData, setFormData] = useState({
    username: '',
    phone: '',
    email: '',
    password: '',
    category: '', // default category
  });

  const [error, setError] = useState('');

  const navigate = useNavigate();

  const handleSignUp = async () => {
    try {
        // Basic form validation
        if (!formData.username || !formData.phone || !formData.email || !formData.password || !formData.category ) {
            setError('All fields are required');
            return;
        }

        const response = await axios.post("http://localhost:3001/registration", formData); // Changed to lowercase

        if (response.data.message === "User registered successfully") {
            // Navigate to the login page
            navigate("/");
        } else if (response.data.message === "User already exists") {
            setError('User already exists');
        }
    } catch (error) {
        setError('An error occurred. Please try again.');
        console.error(error);
    }
};


  return (
    <MDBContainer fluid>
      <div className="p-5 bg-image" style={{backgroundImage: 'url(https://mdbootstrap.com/img/new/textures/full/171.jpg)', height: '300px'}}></div>

      <MDBCard className='mx-5 mb-5 p-5 shadow-5' style={{marginTop: '-100px', background: 'hsla(0, 0%, 100%, 0.8)', backdropFilter: 'blur(30px)'}}>
        <MDBCardBody className='p-5 text-center'>

          <h2 className="fw-bold mb-5">Sign in</h2>

          {error && <div className="alert alert-danger">{error}</div>}

          <MDBRow>
            <MDBCol>
              <MDBInput
                wrapperClass='mb-4'
                label='username'
                id='form1'
                type='text'
                value={formData.username}
                onChange={(e) => setFormData({ ...formData, username: e.target.value })}
              />
            </MDBCol>
            <MDBCol>
              <MDBInput
                wrapperClass='mb-4'
                label='phone'
                id='form2'
                type='text'
                value={formData.phone}
                onChange={(e) => setFormData({ ...formData, phone: e.target.value })}
              />
            </MDBCol>
          </MDBRow>

          <MDBInput
            wrapperClass='mb-4'
            label='Email'
            id='form3'
            type='email'
            value={formData.email}
            onChange={(e) => setFormData({ ...formData, email: e.target.value })}
          />
          <MDBInput
            wrapperClass='mb-4'
            label='Password'
            id='form4'
            type='password'
            value={formData.password}
            onChange={(e) => setFormData({ ...formData, password: e.target.value })}
          />

          <MDBDropdown>
            <MDBDropdownToggle
              className="mb-4 form-control"
              style={{ width: '100%', color: '#333', backgroundColor: 'white', border: '1px solid #A9A9A9', boxShadow:'none', textAlign: 'left'}}
            >
              {formData.category ? formData.category : 'Category'}
            </MDBDropdownToggle>
            <MDBDropdownMenu style={{width:'100%'}}>
              <MDBDropdownItem onClick={() => setFormData({ ...formData, category: 'student' })} style={{ cursor: 'pointer' }}>Student</MDBDropdownItem>
              <MDBDropdownItem onClick={() => setFormData({ ...formData, category: 'faculty' })} style={{ cursor: 'pointer' }}>Faculty</MDBDropdownItem>
              <MDBDropdownItem onClick={() => setFormData({ ...formData, category: 'admin' })} style={{ cursor: 'pointer' }}>Admin</MDBDropdownItem>
            </MDBDropdownMenu>
          </MDBDropdown>

          <MDBBtn className='w-100 mb-4' size='md' onClick={handleSignUp}>
            Sign up
          </MDBBtn>

          <p style={{textAlign:'center'}}>Already have an account? <Link to="/login"> Sign in</Link></p>

        </MDBCardBody>
      </MDBCard>
    </MDBContainer>
  );
}

export default Registration;
